import React from 'react';
import Header from '../components/Header';
import perfil from '../perfil.png'

class ProfileEdit extends React.Component {
  constructor() {
    super();

    this.state = {
      image: '',
      name: '',
      email: '',
      description: '',
    }
  }
  render() {
    return (
      <>
        <Header />
        <div>
          <img id="image-profile" alt="profile" src={ perfil }></img>
          <input name="image" type="text" placeholder="Insira um link:" />
          <h2>Nome</h2>
          <p>Fique à vontade para usar um nome social</p>
          <input type="texet" placeholder='Nome' />
          <h2>Email</h2>
          <p>Escolha um e-mail que consulte diariamente</p>
          <input type="texet" placeholder='usuario@usuario.com.br' />
          <h2>Descrição</h2>
          <p>Sobre mim</p>
          <textarea cols={23} rows={5} ></textarea>
          <br></br>
          <button>Salvar</button>
        </div>
      </>
    );
  }
}

export default ProfileEdit;
